import React, { useState } from 'react';
import { motion } from 'framer-motion';
import '../styles/Contact.scss';

function Contact() {
    return (
        <div id='Contact'>
            <motion.img 
                className='left-hand' 
                src='../img/left-hand.png' alt='left hand' 
                initial={{ x: '-50vw' }} 
                animate={{ x: 0 }} 
                transition={{ x: { type: "spring", stiffness: 200, duration: 1 }, scale: { duration: 0.35 }, }}
            />
            <img className='right-hand' src='../img/right-hand.png' alt='right hand' />
        </div>
    );
}

export default Contact;
